import React from 'react'
import { OverlayTrigger, Popover, Button } from 'react-bootstrap';

const Contact = () => {
    const popover = (
        <Popover id="popover-basic">
          <Popover.Title as="h3">Email Address</Popover.Title>
          <Popover.Content>disneyharley26@gmail</Popover.Content>
        </Popover>
      );

    return(
        <div className='contact'>
            <h3 className='contactText'>Thanks for taking the time to view my portfolio. Please feel free to contact me!</h3>
            <div className='boxes'>
                <div className='icons'>
                    <OverlayTrigger trigger="click" placement="right" overlay={popover}>
                        <a><i class="fas fa-inbox"></i></a>
                    </OverlayTrigger>
                    <a href='https://github.com/harleydi'><i class="fab fa-github"></i></a>
                    <a><i class="fab fa-linkedin"></i></a>

                </div>
            </div>
        </div>
    )
}

export default Contact
